												else { "[0x$($att90flagh)]: Index fits in Index Root" }
								
								# add to tree
								$Null = $ANodes.Nodes["($("Attribute" + $Attributeoffset))"].Nodes.Add("IdxAttribute-Type", "[0x$($residentcontentoffset.tostring('X3'))] Attribute Type: $($attibute90type)")
