								$ANodes.Nodes["($("Attribute" + $Attributeoffset))"].Nodes["IndexEntry_Size"].Tag = @("$($residentcontentoffset + 8)", "4")
								$ANodes.Nodes["($("Attribute" + $Attributeoffset))"].Nodes["Clusters_PerIndex"].Tag = @("$($residentcontentoffset + 12)", "4")
