								# Add IndexEntries Sub-Node to tree
								$indexEntriesNodes = $ANodes.Nodes["($("Attribute" + $Attributeoffset))"].Nodes.Add("IndexEntries", "Index Entries")
								$ANodes.Nodes["($("Attribute" + $Attributeoffset))"].Nodes["IndexEntries"].NodeFont = New-Object Drawing.Font($treeview1.Font, [Drawing.FontStyle]::Bold)
								
								# idx entry counter
								$nrofidxentries = 1
								
								# get Index Entries
								for ($idx = 0; $idx -lt ($att90ihtotalsize - $att90ihcontentoffset); $idx = $idx + $idxentrylength)
								{
									# Flag values for the index entry flag field:
