										$Null = $indexEntriesNodesChild.Nodes.Add("Filename", "[0x$(($firstoffset + 82).tostring('X3'))] Filename: $($idxFilename)")
										$indexEntriesNodesChild.Nodes["Filename"].ForeColor = 'Blue'
