										#$indexEntriesNodesChild.Nodes["Filename"].NodeFont =New-Object Drawing.Font($treeview1.Font, [Drawing.FontStyle]::Bold)
									
										# VCN (of child node in $INDEX_ALLOCATION (field exists only if flag is set)
