				# Copy Selection
				$dataObj = $DataGridView1.GetClipboardContent()
				[System.Windows.Forms.clipboard]::SetDataObject($dataObj)
				# remove header to get normal selected value
				$datagridview1.ClipboardCopyMode = 'EnableWithAutoHeaderText'
			}
			else
			{
				# Copy Selection
				$dataObj = $DataGridView1.GetClipboardContent()
