			}
			
		}
		if ($datagridview1.GetCellCount('Selected') -and !!$datagridview1.SelectedRows)
		{
			# Add with header
			$datagridview1.ClipboardCopyMode = 'EnableAlwaysIncludeHeaderText'
			# Copy Selection
